    id: "",
    product: "",
  });
  const handleClick = (e) => {
    e.preventDefault();
    setProduct({
      ...product,
      [e.target.name]: e.target.value
    })
    console.log("click", e.target.name, e.target.value);
  };
  return (
    <div>
      ProductForm
      <form>
        <input type="text" placeholder="" name="product" />
        <button onClick={handleClick}>guardar</button>
      </form>
    </div>
  );
};
